function App() {

  const usersData = () => {
    alert("users Data");
  };


  return (
    <div class="topnav">
      <a onClick={() => usersData()}>Users</a>
      <a href="#news">News</a>
      <a href="#contact">Contact</a>
    </div>
  );
}

export default App;
